def is_vehicle_in_safe_position(vehicle_point_object,grid):
  for point in vehicle_point_object.input_co_ordinates:
    if(is_within_grid( idx(point[0]),idx(point[1])) and
       (grid[idx(point[0])][idx(point[1])]==0)):
      continue
    else:
      return False
  return True

